    function _clearApproval(uint256 tokenId) private {
        if (_tokenApprovals[tokenId] != address(0)) {
            _tokenApprovals[tokenId] = address(0);
        }
    }
}

interface IDeTronEvent {
    function mint(address to, uint256 value) external;

}

/**
 * @title Full TRC721 Token for Sun Network DAppChains
 */

contract DeTronEvent is TRC721, IDeTronEvent {
    using SafeMath for uint256;
    // Transfer Gateway contract address
    address public gateway;

    string public name;
    string public symbol;
    // address public owner;

    struct TokenMeta {
        uint256 id;
        uint256 price;
        string name;
        string uri;
        bool sale;
    }

    mapping(uint256 => TokenMeta) private _tokenMeta;

    /**
     * @dev Constructor function
     */

    constructor(
        address _gateway,
        string memory _name,
        string memory _symbol
    ) {
        gateway = _gateway;
        name = _name;
        symbol = _symbol;
    }

    modifier onlyGateway() {
        require(msg.sender == gateway);
        _;
    }

    /**
     * @dev Internal function to mint a new token.
     * Reverts if the given token ID already exists.
     * @param to The address that will own the minted token
     * @param tokenId uint256 ID of the token to be minted
     */
    function mint(address to, uint256 tokenId) external override onlyGateway {
        require(to != address(0));
        require(!_exists(tokenId));

        _tokenOwner[tokenId] = to;
        _ownedTokensCount[to] = _ownedTokensCount[to].add(1);

        emit Transfer(address(0), to, tokenId);
    }
}

